import ExpenseItem from './components/ExpenseItem'

function App() {


  const arr=[
    {
     desc:"car insurance",
     price:23.4,
     date:new Date(2020,12,28),
    },
    {
      desc:"rent",
     price:21.5,
     date:new Date(2021,2,20),
    },
    {
      desc:"laundary",
     price:10.2,
     date:new Date(2021,3,10),
    },
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <p>React is so much fun to learn</p>
      <ExpenseItem desc={arr[0].desc} price={arr[0].price} date={arr[0].date}></ExpenseItem>
      <ExpenseItem>desc={arr[1].desc} price={arr[1].price} date={arr[1].date}</ExpenseItem>
      <ExpenseItem>desc={arr[2].desc} price={arr[2].price} date={arr[2].date}</ExpenseItem>
    </div>
  );
}

export default App;
